import React,{useState} from 'react'
import { Link, useNavigate } from 'react-router-dom'
//const a=document.getElementById("id");
export default function Concert() {
  
 
  //const [RegisterStatus, setRegisterStatus] = useState("");
    const navigate = useNavigate();
    const [values] = useState({
      name: '',
      email: '',
      username: '',
      password: '',
    });
   // const [errors, setErrors] = useState({});
    // const [concertData, setConcertData] = useState([]); // New state to store the retrieved data
  
    const handleSubmit = (e) => {
      e.preventDefault();
  
      fetch("http://localhost:8081/Edit2", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          id: values.id,
          name: values.cname,
          cimage: values.cimage,
          tname: values.tname,
          timage: values.timage,
          data: values.date,
          time: values.time,
          ticket: values.ticket
         
        }),
      })
        .then((res) => res.json())
        .then((data) => {
          if (data.message) {
            //setRegisterStatus(data.message);
            navigate('/ShowAndId');
            //a=values.id;
          } else {
            //setRegisterStatus("Concert created");
            console.log(data);
            navigate('/ShowAndId');
           // a=values.id;
          }
        })
        .catch((error) => {
          console.error("Error:", error);
        });
    };
    const handleInput = (event) => {
      const { name, value } = event.target;
      setValues((prev) => ({ ...prev, [name]: value }));
    };
  
  return (

    <>
    <div className='text-center'>
        {/* <div className="btn-group" role="group" aria-label="Basic example">
  <button type="button" className="btn btn-success"><Link className="nav-link " aria-current="page" to="/Create">Create New Student Registration</Link></button>
  <button type="button" className="btn btn-warning"><Link className="nav-link " aria-current="page" to="/Edit">Edit Student Registration</Link></button>
  <button type="button" className="btn btn-danger"><Link className="nav-link " aria-current="page" to="/Delete">Delete Student Registration</Link></button>
</div> */}
</div>

<h1>Edit Existing Student Registration</h1>
<div className='text-center'>

</div>
<div className="mb-3 container">
<label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3 ">Student Registration Id</label>
  <input type="number" onChange={handleInput} className=""  name="id" placeholder="Concert ID to Edit" id="id" />

  <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3">Student Name</label>
  <input type="text"  onChange={handleInput} className=" my-2" name="name" id="Concert_Name" placeholder="Name"/>
  <label htmlFor="formFile" className="form-label col-5 "></label>

</div>
<div className="mb-3 container">
  <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-5" type="text">Username</label>
  <input type="text"  onChange={handleInput} name="username" className="my-2 mx-1" id="date" placeholder="Username"/>
  <label htmlFor="formFile" className="form-label col-6 "></label>

</div>
<div className="mb-3 container">
<label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3">Email</label>
  <input type="email"  onChange={handleInput} name="email"className="my-2 mx-3 " id="Team_Name" placeholder="`Email"/>
  <label htmlFor="formFile" className="form-label col-5 "></label>
 </div>
 
<div className="mb-3 container">
  <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-5" type="text">Password</label>
  <input type="password"  onChange={handleInput} name="password" className="my-2 mx-1" id="date" placeholder="Password"/>
  <label htmlFor="formFile" className="form-label col-6 "></label>

</div>
<div className='text-center'>
<div className="mb-3">

</div>

<div><button type="submit" onClick={handleSubmit} className="btn btn-success">Submit</button>
</div>
</div>



    
    </>



   
  )
}
